import "./styles/Home.css"
import Green from "./images/green.png";

const Home = () => {
    return (
        <div>
            <div className="home-image">
                <div className="two-header">
                    <div className="left-home-logo">
                        <img src={Green} width="80px"></img>
                        <h1>ZCP</h1>
                    </div>
                </div>
            </div>
            <h1>Hola</h1>
        </div>
    );
}

export default Home;
